import React from 'react';

const Pourquoi = () => (
  <>
    <h2>Pourquoi Oniti</h2>
      <p>Le large panel de compétences de l'agence (logiciel, site et app web, audit et conseil) sont riches de promesses pour un stagiaire comme moi. Je n'ai pas encore assez de recul pour réussir à juger de la technicité des projets présentés par les différentes agences. En revanche le travail de veille et de transmission ainsi que les utopies de civilisation non marchande et le dégoût profond des excès de notre monde me parle profondément.
      </p>
  </>
);

export default Pourquoi;
